  false,\n\t\"url\": null,\n\t\"notes\": \"The dataset is a list of all the Title
  VIII fair housing cases filed by FHEO from 1/1/2007 - 12/31/2012 including the case
  number, case name, filing date, state and county of the alleged violation, and the
  bases for the alleged discriminatory acts. The Federal bases are race, color, national
  origin, religion, sex, disability, familial status and retaliation for filing a
  fair housing complaint. Some of the bases have been broken out into more detailed
  groupings (Race - Asian, etc.) A single case may have multiple bases. The data can
  be aggregated to the county or state level to show patterns in the quantity and
  bases of fair housing complaints filed.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
